import LoginForm from "../Components/LoginComponents/LoginForm";
import Navigation from "../Components/Navigation";
import { Page, Main } from "govuk-react";
function Login() {
  return (
    <>
      <Page > <Navigation
        pageLink1="/"
        PageName1="home"
        pageLink2="/login"
        PageName2="Login"
        pageLink3="/NhsNumber"
        PageName3="Register"
      />
        <LoginForm />
      </Page>
    </>
  );
}

export default Login;
